[mod-setting-description]
rampant-unitAndSpawnerFadeTime=咬人尸体在周围停留的时间（秒）
rampant-unitsAffectedByTiles=（可能导致同步）单位受到瓷砖移动修改器的影响
rampant-oldRedEnemyMapColor=将敌方地图颜色还原为普通敌方地图颜色
rampant-unitSpawnerBreath=现在单位产卵者呼吸空气，所以他们会受到毒素胶囊之类的东西的影响
rampant-useDumbProjectiles=使用可阻挡的炮弹攻击。如果你使用新的敌人，这应该被检查。
rampant-attackWaveGenerationThresholdMax=一个区块必须达到的总分才能产生攻击波。不影响香草口味。随进化因子线性缩放（起始阈值@0.0 evolution）
rampant-attackWaveGenerationThresholdMin=一个区块必须达到的总分才能产生攻击波。不影响香草口味。随进化因子线性缩放（结束阈值@100.0 evolution）
rampant-attackWaveMaxSize=如果你想改变攻击波随进化的比例，你需要修config.llua在zip文件中。
rampant-safeBuildings=这需要切换安全建筑切换工作。这将导致安全的实体在可销毁标志设置为false的情况下重新生成，这将导致它们不再成为目标或受到损坏。
rampant-safeBuildings-curvedRail=使弯曲的轨道免受咬伤
rampant-safeBuildings-straightRail=使直轨免受咬伤
rampant-safeBuildings-bigElectricPole=使大电线杆不被咬伤
rampant-safeBuildings-railChainSignals=使轨道链信号免受咬伤
rampant-safeBuildings-railSignals=使铁路信号免受人咬
rampant-safeBuildings-lamps=使灯免受叮咬
rampant-safeBuildings-trainStops=使火车站不受人咬
rampant-permanentNocturnal=切换此选项将导致夜间产生猖獗的攻击波。还没有关闭香草攻击组。与发条模式一起使用效果更好。
rampant-aiPointsScaler=??.0??00.0之间。这将缩放ai在每个逻辑周期内获得多少个动作点来执行攻击波之类的动作??.3-非常简单，0.75-简单，1.0-中等??.25+-硬
rampant-addWallResistanceAcid=切换此选项将使所有墙实体的耐酸性增??60，以减少喷壶对墙造成的损坏。
rampant-removeBloodParticles=当咬人者被杀死时产生的血液颗粒会导致UPS峰值，这会移除它们。
rampant-enableSwarm=这减少了单位碰撞遮罩的大小，使他们减少了路径碰撞并消除了攻击
rampant-attack-warning=显示一条消息，警告玩家攻击波即将到来
rampant-newEnemies=添加新闻敌人，将分散在世界各地。这增加了对RAM的要求。每比特、蠕虫和巢穴各有1个变化，5层内存预计增??GB。随着20个变化和10层设置，预计最多可增加9GB的RAM。变化增加了随机性的每一层叮咬，蠕虫，或巢穴。层是咬人的力量等级。
rampant-enemySeed=为所有单位生成提供能量的种子，所以如果你想改变敌人的属性，就改变这个
rampant-deadZoneFrequency=The percentage of zones that start without worms or nests
rampant-newEnemyVariations=这个数字对应于每层的变化数。这增加了随机性的每一层权力水平。最小??，最大??0
rampant-disallowFriendlyFire=防止敌人的唾沫和蠕虫通过飞溅伤害伤害同一部队的单位或建筑物
rampant-tierStart=这是敌人的起始级别，当为指定的层数生成一组敌人时，将使用该级别，并根据所选层数线性增加到结束层。从健康角度看，每层大致如下??-15,2-75,3-150,4-250,5-1000,6-2000,7-3500,8-7500,9-15000,10-30000）。最小??，最大??0
rampant-tierEnd=这是从开始层线性增加所选层的结束层级别。从健康角度看，每层大致如下??-15,2-75,3-150,4-250,5-1000,6-2000,7-3500,8-7500,9-15000,10-30000）。最小??，最大??0
rampant-enableMigration=这将允许人工智能扩展其蠕虫和巢穴。考虑位扩展的映射设置。

rampant-enableShrinkNestsAndWorms=减少巢穴和蠕虫的碰撞盒大??0%。由于碰撞框小于实体图形，可能导致实体重叠。
rampant-attackWaveGenerationUsePlayerProximity=包括玩家信息素的数量阈值块与咬巢，将产生一个猖獗的攻击波。不影响香草口味
rampant-attackPlayerThreshold=一个区块必须达到的分数，才能对攻击阈值做出贡献。增加可以减少玩家信息素云的影响。

rampant-unkillableLogisticRobots=这将使后勤机器人免疫所有损害
rampant-unkillableConstructionRobots=这将使建筑机器人免疫所有伤害


