rampant-unitBiterSpeedScaler=按一定比例缩放所有新的敌人咬人速度
rampant-unitBiterDamageScaler=按一定比例增加所有新的敌人咬伤伤害
rampant-unitBiterRangeScaler=按一定比例增加所有新的敌人咬人攻击范围
rampant-unitBiterHealingScaler=按一定比例增加所有新的敌人咬伤治疗
rampant-unitSpitterHealthScaler=按比例缩放所有新敌人的生命值
rampant-unitSpitterSpeedScaler=按一定比例缩放所有新敌人的吐痰速度
rampant-unitSpitterDamageScaler=按一定比例增加所有新敌人的喷溅伤害
rampant-unitSpitterRangeScaler=按百分比缩放所有新敌人的喷溅范围
rampant-unitSpitterHealingScaler=按比例缩放所有新敌人的喷溅治疗
rampant-unitDroneHealthScaler=所有新敌方无人机的生命值按百分比缩放。无人机来自“产卵者”和“黄蜂”两个派系
rampant-unitDroneSpeedScaler=按一定比例缩放所有新的敌人无人机速度。无人机来自“产卵者”和“黄蜂”两个派系
rampant-unitDroneDamageScaler=按一定比例增加所有新的敌人无人机伤害。无人机来自“产卵者”和“黄蜂”两个派系
rampant-unitDroneRangeScaler=按一定比例缩放所有新的敌人无人机射程。无人机来自“产卵者”和“黄蜂”两个派系
rampant-unitDroneHealingScaler=按一定比例缩放所有新的敌人无人机治疗。无人机来自“产卵者”和“黄蜂”两个派系
rampant-unitWormHealthScaler=按百分比缩放所有新的敌人蠕虫生命值
rampant-unitWormDamageScaler=按一定比例增加所有新的敌人蠕虫伤害
rampant-unitWormRangeScaler=按百分比缩放所有新的敌人蠕虫范围
rampant-unitWormHealingScaler=按一定比例缩放所有新的敌人蠕虫治疗
rampant-unitSpawnerHealthScaler=按百分比缩放所有新的敌人单位产卵者生命值
rampant-unitSpawnerOwnedScaler=按百分比缩放所有新的敌人单位产卵器每个产卵器控制的最大单位数
rampant-unitSpawnerSpawnScaler=按百分比缩放所有新的敌人单位产卵单位数量在任何一次
rampant-unitSpawnerRespawnScaler=按百分比缩放所有新的敌人单位产卵时间来繁殖新单位
rampant-unitSpawnerHealingScaler=按一定比例增加所有新的敌人单位产卵者的治疗
rampant-unitHiveHealthScaler=按百分比缩放所有新的敌人单位蜂巢生命值
rampant-unitHiveHealingScaler=按百分比缩放所有新的敌人单位蜂巢治疗
rampant-unitHiveRespawnScaler=按百分比缩放所有新的敌人单位蜂巢时间来产生新单位


rampant-raidAIToggle=从你的污染云之外切换ai攻击方
rampant-siegeAIToggle=从你的污染云外切换ai围攻方或巢穴

rampant-laserEnemy=激光叮咬势力，激光是大阻力，电是小阻力。有咬人和吐口水的单位类型。
rampant-waspEnemy=黄蜂咬者派系，只吐口水单位和每个吐口水的小无人机。
rampant-spawnerEnemy=产卵??咬人派系，只有产卵者产生的唾沫和吐出的卵孵化成咬人。
rampant-trollEnemy=巨魔咬人派系，生命回复高，对火的主要弱点，对物理的轻微抵抗，对爆炸的轻微抵抗。
rampant-fastEnemy=咬人速度快，移动速度快，抗爆炸能力小。
rampant-infernoEnemy=地狱咬人派系，只有吐出燃烧的酸液的唾沫才能燃烧一切。耐酸、防火性强，毒害性小。
rampant-nuclearEnemy=核咬者派系，只有像原子弹一样爆炸的咬者。爆炸性的主要弱点。
rampant-electricEnemy=电咬者派系，只有在一条直线上攻击多个实体的短距离攻击。大电阻对电，小电阻对激光。
rampant-fireEnemy=火咬人派系，主要抵抗酸和火。
rampant-suicideEnemy=自杀咬人派系，只有当他们攻击时爆炸的咬人。对毒药的抵抗力不强，对爆炸的抵抗力很强。
rampant-physicalEnemy=物理咬者势力，只有咬者。主要抵抗物理，主要抵抗爆炸，轻微弱电。
rampant-acidEnemy=酸咬者势力，主要抗酸，次抗毒害。
rampant-energyThiefEnemy=能量窃贼咬人派系，主要抵抗电，次要抵抗激光。摧毁动力结构会产生排水晶体。
rampant-poisonEnemy=毒蛇派系，只有毒蛇。死亡之时创造一个云，治疗咬人和伤害玩家的物体。主要抗毒物，轻微弱电，轻微爆炸，轻微激光，轻微防火。

rampant-disableCollidingProjectiles=咬人弹不再与其他咬人、蠕虫或巢穴相撞。其他的东西仍然会与比特弹相撞。
rampant-enableFullMapScan=此设置会使游戏地图缓慢地扫描在factorio事件系统之外创建或销毁的实体。（如果一个模组没有使用脚本_raised_build或script_raised_destructed，这将导致猖獗最终仍然与游戏地图一致）

rampant-suppress-surface-change-warnings=关闭更改曲面时收到的警告，警告只应在第一次访问新曲面时出现。

rampant-maxNumberOfBuilders=更多的建设者需要更多的UPS。
rampant-maxNumberOfSquads=更多的小队需要更多的UPS。

[description]
rampant-set-surface=你正在将猖獗的AI活动面设置为\n__1__
rampant-error-set-surface=If you wish to change Rampants active surface run, \n/SetRampantAISurface SurfaceName\nwhere SurfaceName is the name of the surface you want to switch to.
rampant-invalid-set-surface=表面名称无效。\n__1__
rampant-bobs-nee-newEnemies=BOB敌人或NEE已经被发现有新的敌人，这些MOD中的每一个都将与新的敌人一起使用。当激进分子的新敌人活跃时，由猖獗显式产生的bob或NEE单位产卵者不再被支持。
rampant-get-surface=Rampant can only have one active surface.\nYou are on the surface named \n__1__\nRampant thinks the active surface is named \n__2__\nIf you wish to change Rampants active surface run\n/SetRampantAISurface __1__
rampant-change-surface=Rampant can only have one active surface.\nYou are on the surface named \n__1__\nRampant thinks the active surface is named \n__2__\nIf you wish to change Rampants active surface run\n/SetRampantAISurface __1__\nThese messages can be disabled in the per player mod settings.\nThese messages only appear the first time the player reaches a surface.
rampant-already-set-surface=猖獗活动表面已设置为\n__1__
